import React, { Component } from 'react';
import '../styles/NameField.css';

class NameField extends Component {
  constructor(props) {
    super(props)
    this.state = {value: ''};
  }
  render() {
    return (
      <label>
        Name:
        <input type="text" id="char-name" value={this.state.value}/>
      </label>
      // <input type="submit" value="Submit" />
    );
  }
}

export default NameField;
